#include <iostream>
#include <vector>
#include <algorithm>

using namespace std;

class Solution
{
public:
    int maxBoxesInWarehouse(vector<int> &boxes, vector<int> &warehouse)
    {
        sort(boxes.begin(), boxes.end());
        int count = 0, i = 0, k = min(warehouse.size(), boxes.size());
        if (boxes.size() == 0 || warehouse.size() == 0)
            return 0;
        while (k > 0)
        {
            int j = 0, pos = -1;
            while (j < k && boxes[i] <= warehouse[j])
            {
                pos = j;
                j++;
            }
            if (pos != -1)
            {
                // cout << "(" << pos << ") " << warehouse[pos] << "\t (" << i << ") " << boxes[i] << endl;
                i++;
                count++;
            }
            if (pos == -1)
                break;
            k = pos;
        }
        return count;
    }
};

